import React from 'react';

function Greeting()
{
    var date = new Date();
    date = 13;
    var message = '';
    const fontClr = {};
    
if(date>=0 && date<12)
{
    message = 'Good Morning its '+date;
    fontClr.color='green';
}
else if(date>=12 && date<16)
{
    message = 'Good Afternoon its '+date;
    fontClr.color='orange';
} 
else if(date>=16 && date<20)
{
    message = 'Good Evening its '+date;
    fontClr.color='blue';
}
else if(date>=20 && date<24)
{
    message = 'Good Evening its '+date;
    fontClr.color='black';
}
else{
    message = 'Wrong Hour '+date;
    fontClr.color='red';
}
return (
<>
<div>
<h1>
Hello Ajay..
<span style={fontClr}>
    {message}
</span>
</h1>
</div>
</>
);
}
export default Greeting
